INSERT INTO `storefront_recepti` VALUES (2,'Francuski Tost','slike/francuski-tost.jpg','2022-03-09','Jednostavno',1,'4','Francuski tost je jelo koje se pravi od isječenog hljeba namočenog u razmućena jaja, šećer i obično mlijeko, a zatim prženog u tiganju. Danas je francuski tost omiljen u cijelom svijetu, a servira se uz voće, čokoladu ili u slanim varijantama sa šunkom i sirom.',25,'Dorucak'),(3,'Lazanje sa mljevenim mesom','slike/lazanje.jpg','2022-03-15','Srednje',1,'4+','Domaće lazanje sa slojevima mljevenog mesa u paradajz sosu, kremastog bachamel sosa i mozzarelle na vrhu. Ukoliko želite da naučite kako da napravite najbolje lazanje isprobajte ovaj recept.',110,'Rucak,Vecera'),(4,'Cheeseburger pasta','slike/cheesburger.jpg','2022-02-08','Jednostavno',1,'2','Testenina u kremastom sosu od mljevene junetine i sira neodoljivo podsjeća na ukus cheeseburgera. Za ovo jelo koriste kraću tjesteninu po izboru kao što su makaroni, fusili, penne ili ziti.',40,'Rucak,Vecera'),(5,'Palačinci sa nutellom','slike/istockphoto-1135386720-612x612.jpg','2022-02-08','Jednostavno',2,'4','Klasične, meke i ukusne palačinke uvijek su dobra ideja, a uz ovaj odličan i vrlo jednostavan recept, baš će uvijek uspjeti. Najbolje od svega - sve sastojke imate u kuhinji.',20,'Dorucak,Poslastica,Uzina'),(8,'Sendvič s dimljenom pastrmkom','slike/sendvic-s-dimljenom-pastrmokom.jpg','2022-05-25','Jednostavno',1,'1','Zdrav sendvič je uvek dobra opcija. Sve češće u supermarketima pronalazim filete dimljene pastrmke spremne za upotrebu. Ova slatkovodna riba puna je proteina i omega 3 masnih kiselina i pristupačnija je od prilično skupog dimljenog lososa, orade, brancina... Sendvič možete pripremiti na hiljadu načina, sa sastojcima koje volite.',5,'Dorucak,Uzina'),(9,'Oblatna sa mlijekom u prahu i čokoladom','slike/How-To-Make-How-To-Make-Oblatne-s-Čokoladnom-Karamel-Kremom-Tort-Wafers-Cake-25.jpg','2022-06-05','Jednostavno',1,'4+','Recepti sa oblatnama su brzi i praktični, a svi ih vole i uživaju u grickanju. Zato predlažem odlične napolitanke sa čokoladom i mljevenim keksom koje će oduševiti ljubitelje ovakvih slatkiša. Biće odličan izbor, bez obzira da li se radi o ukusnoj užini uz popodnevnu kafu ili svečanom stolu sa velikim brojem kolača.',10,'Poslastica'),(10,'Krofne s mliječnom čokoladom','slike/IMG_7403.jpg','2022-06-05','Jednostavno',2,'2','Jednostavan recept za krofne sa mliječnom čokoladom koji se može poslužiti kao poslastica uz kafu ili za doručak.',45,'Dorucak,Poslastica,Uzina'),(12,'Pileći ražnjići sa povrćem','slike/shutterstock_587620751.jpg','2022-06-06','Jednostavno',2,'4','Dugi topli ljetni dani, vesela druženja uz roštilj, pileći ražnjići s povrćem i pivo najbolja su moguća simbioza. Ukoliko nešto od toga nedostaje, ne brinite i držite se pilećih ražnjića jer – bez ostalog se može.',45,'Rucak'),(15,'Cheesecake sa jagodama','slike/tumblr_1a85dd548ecd20341a1af4582677c6af_cc513ca5_500_3I5DowI.jpg','2022-07-14','Srednje',1,'4+','Kombinacija sira i jagoda se odlično slaže. Ako nemate jagode, možete koristiti druge bobice..',60,'Poslastica'),(16,'Panna Cotta','slike/DSC09110_1.jpg','2022-07-14','Jednostavno',1,'1','Jednostavna talijanska slastica koja u doslovnom prijevodu znači kuhana krema. Strukturom slična pudingu, kremasta panna cotta je poprilično neutralnog okusa, ali se zato odlično slaže s voćem i voćnim preljevima.',40,'Poslastica'),(17,'Piletina sa senfom','slike/shutterstock_370089125.jpg','2022-07-14','Jednostavno',1,'4','Jednostavan i ukusan recept koji bi vam mogao postati jedan od najdražih.',35,'Rucak'),(18,'Salata s piletinom i avokadom','slike/IMG_7757.jpg','2022-08-23','Jednostavno',2,'4','Salata sa piletinom je najjednostavniji i najzdraviji obrok koji možete napraviti!',30,'Dorucak,Rucak,Vecera'),(20,'Tortilja sa šunkom, sirom i paradajzom','slike/IMG_8001_Tmrxjoa.jpg','2022-08-23','Jednostavno',1,'1','Jednostavan i ukusan recept za vaš doručak.',5,'Dorucak'),(22,'Zobena kaša s jagodama','slike/IMG_8087_lcFZ2gk.jpg','2022-08-23','Jednostavno',1,'4','Ovaj recept za zobenu kašu sa jagodama je jednostavan za pravljenje i prepun proteina i vlakana. Osim toga, ne sadrži rafinirane šećere i stoga je napravljen od zdravih sastojaka koji će vam dati energiju za radnu sedmicu koja je pred vama!',20,'Dorucak'),(23,'Sendvič s pilećim fileom i krem sirom','slike/IMG_7712.jpg','2022-08-24','Jednostavno',1,'4','Jedan od mojih omiljenih recepata',20,'Dorucak,Uzina'),(24,'Polpete s pireom','slike/pire-i-polpete-2.jpg','2022-08-24','Srednje',1,'4+','Preukusan recept za polpete sa pierom',60,'Rucak,Vecera'),(26,'Francuski tost sa feta sirom i paradajzom','slike/IMG_7500.jpg','2022-08-25','Jednostavno',1,'2','Recept za slanu varijantu francuskog tosta.',30,'Dorucak'),(27,'Domaći sladoled od jagode','slike/IMG_8575-1024x683.jpg','2022-08-25','Jednostavno',1,'1','Slijedite ovaj jednostavani recept i naučite kako da napravite domaći sladoled od jagode. Ovaj domaći sladoled od jagoda je tako kremast i ukusan. Ovaj recept zahtijeva samo 3 sastojka i 5 minuta rada. Nije potrebna mašina za sladoled i posebna oprema.',10,'Poslastica');
/*!40000 ALTER TABLE `storefront_recepti` ENABLE KEYS */;
UNLOCK TABLES;

