INSERT INTO `storefront_receptisteps` VALUES (1,'<p>U veću zdjelu dodati jaja, mlijeko, &scaron;ećer, aromu vanilije, cimet i so. Mije&scaron;ati uz pomoć miksera 1-2 minute.</p>',2),(17,'<p>Dodajte mlijeko u srednju &scaron;erpu i ravnomjerno pospite želatin po povr&scaron;ini. Ostavite 5 minuta da nabubri i omek&scaron;a. Stavite na srednje jaku vatru i pjenjačom umije&scaron;ajte želatin u mlijeko da nema grudvica. Mije&scaron;ajte 2 do 3 minute dok se potpuno ne otopi.</p>',16),(18,'<p>Dodajte vrhnje za &scaron;lag, &scaron;ećer, ekstrakt vanilije i dobar prstohvat soli. Nastavite mije&scaron;ati dok se &scaron;ećer ne otopi i smjesa se zagrije &ndash; oko 5 minuta.</p>\r\n<p>Smjesa ne smije da proključa, pa smanjite vatru ako primijetite da je počela previ&scaron;e da se zagrijava. Maknite sa vatre i dodajte limunovu koricu.</p>\r\n<p>Ostavite smjesu oko 15 minuta da se ohladi i povremeno mije&scaron;ajte da se brže ohladi i da se na povr&scaron;ini ne stvori kožica.</p>\r\n<p>Ako vam se ba&scaron; ne da mije&scaron;ati, gotovu smjesu možete prekriti plastičnom folijom i spriječit ćete stvaranje pokožice.</p>',16),(19,'<p>Podmažite 6 manjih posuda za pečenje od 180 ml (male posude za pečenje). Nakon &scaron;to ste ih namazali, možete papirnim ubrusom preći preko ivica i dna da obri&scaron;ete vi&scaron;ak ulja - želite da namastite tepsije u tankom sloju.</p>\r\n<p>&nbsp;</p>\r\n<p>Uklonite limunovu koricu iz smjese hvataljkama i ponovo dobro promije&scaron;ajte, a zatim sipajte u staklenu mjericu i ravnomjerno podijelite po plehovima. Ostavite u frižideru dok se ne stegne - najmanje 4 sata ili do 2 dana</p>',16),(20,'<p>Prije serviranja, napunite malu činiju vrućom vodom. Da biste lak&scaron;e odvojili panna cottu od tiganja, uronite ih u vruću vodu na nekoliko sekundi, pazeći da voda ne uđe u tepsiju.</p>\r\n<p>&nbsp;</p>\r\n<p>Stavite ravnu lopaticu pod vruću vodu, obri&scaron;ite je krpom, pa pažljivo obiđite ivice tiganja, koje ćete zatim okrenuti na poslužavnik.</p>\r\n<p>&nbsp;</p>\r\n<p>Ako panna cotta ne ispadne, možete malo protresti tepsiju ili lupkati njome po dnu.</p>',16),(21,'<p>Poslužite punjeno pečenim voćem.</p>',16),(23,'<p>Zagrejte rernu na 200 stepeni. Pomije&scaron;ajte sireve i senf. Svaki pileći file narežite i napunite smjesom od senfa.</p>',17),(24,'<p>Punjene filee omotajte s dva nareska slanine.</p>',17),(25,'<p>Začinite, stavite na papir za pečenje te pecite 20 do 25 minuta.</p>',17),(26,'<p>Zagrijati tavu na srednje jakoj temperaturi. Otopiti 10 gr maslaca.</p>',2),(27,'<p>Umakati kri&scaron;ke tosta u dobijenu smjesu, ocijediti vi&scaron;ak tečnosti i staviti da se peče.</p>',2),(28,'<p>Peći na laganoj vatri 3-4 minute s jedne i zatim jo&scaron; 3 minute s druge strane. U zavisnosti od veličine tave, možete peći 2-3 kri&scaron;ke u isto vrijeme.</p>',2),(29,'<p>Francuski tost poslužiti s javorovim sirupom, &scaron;umskim voćem, &scaron;ećerom u prahu i po želji &scaron;lagom.</p>',2),(30,'<p><strong>Meso:&nbsp;</strong>U dubokoj tavi zagrijati maslinovo ulje. Dodati mljeveno meso. Pržiti uz često mije&scaron;anje dok meso ne porumeni. Zatim dodati luk, bijeli luk, 1 malu ka&scaron;iku soli, 1/2 male ka&scaron;ike bibera, origano i papriku. Izmije&scaron;ati. Dodati paradajz pastu, paradajz sos, vodu i lovor. Nakon &scaron;to zavri kuhati na niskoj temperaturi 40-60 minuta.</p>',3),(31,'<p><strong>Bechamel sos:&nbsp;</strong>U &scaron;erpi otopiti maslac. Zatim dodati bra&scaron;no, mije&scaron;ati dok ne dobijete gustu pastu. Mije&scaron;ajući iz vi&scaron;e puta dodavati mlijeko. Kuhati dok ne dobijete gust sos. Dodati parmezn, 1/4 male ka&scaron;ike soli, 1/4 male ka&scaron;ike bibera i mu&scaron;katni ora&scaron;čić. Izmije&scaron;ati.</p>',3),(32,'<p>Pećnicu zagrijati na 180&deg;C.</p>',3),(33,'<p><strong>Redanje:&nbsp;</strong>U pekač rasporediti tanki sloj mljevenog mesa, preko redati kore lazanje, zatim rasporediti 1/3 mljevenog mesa, a preko 1/4 bachamel sosa. Preko rasporediti 1/4 naribane mozzarelle. Postupak ponoviti jo&scaron; 2 puta. Zavr&scaron;iti s korama lazanje, bachamel sosom i naribanom mozzarellom.</p>',3),(34,'<p>Pekač pokriti aluminijskom folijom. Peći oko 40 minuta, a zatim skinuti foliju i peći jo&scaron; 15-20 minuta.</p>',3),(35,'<p>Izvaditi iz pećnice. Sačekati da se ohladi 15-20 minuta prije posluživanja. Prijatno!</p>',3),(36,'<p>Zagrijte veliki lonac na srednjoj vatri. Dodajte maslinovo ulje, luk i junetinu i začinite solju i biberom. Pržite oko 10 minuta, ili dok ne porumeni. Povremeno mije&scaron;ajte, lomeći velike komade mesa. Umije&scaron;ajte čili u prahu, dimljenu papriku i bijeli luk u prahu i kuhajte jo&scaron; minut.</p>',4),(37,'<p>Dodajte tjesteninu i tikvice i dobro promije&scaron;ajte. Ulijte temeljac, mlijeko i koncentrat paradajza i promije&scaron;ajte da se sjedini</p>',4),(38,'<p>Ostavite da se kuha na srednje jakoj vatri oko 5-8 minuta, odnosno dok tjestenina ne postane al dente. Povremeno pomije&scaron;ajte kako se tjestenina ne bi zalijepila za dno lonca.</p>',4),(39,'<p>Umije&scaron;ajte naribani sir i kuhajte jo&scaron; nekoliko minuta dok ne postane kremasto. Testeninu podjelite na tanjire i pospite svježim per&scaron;unom.</p>',4),(40,'<p>U velikoj posudi pomije&scaron;ajte jaja i mlijeko, pa dodajte bra&scaron;no i promije&scaron;ajte. Dodajte puter i sol i mije&scaron;ajte dok se sastojci ne sjedine. Postepeno dodavati vodu uz mje&scaron;anje.</p>',5),(41,'<p>Zagrijte lagano nauljenu tiganj za palačinke na srednjoj vatri. Sipajte ili zagrabite smjesu na tiganj, koristeći oko &frac14; &scaron;olje za svaku palačinku. Okrećite posudu kružnim pokretima da se smjesa ravnomjerno rasporedi.</p>',5),(42,'<p>Pecite palačinku oko 2 minute, ili dok dno ne porumeni.</p>\r\n<p>Spatulom odvojite palačinku od tiganja, okrenite i pecite drugu stranu. Poslužite toplo uz namaz po izboru.</p>',5),(43,'<div class=\"col-lg-2\">&nbsp;</div>\r\n<div class=\"col-lg-10\">\r\n<div class=\"direction-box-layout1\">\r\n<div class=\"item-figure\">Kri&scaron;ku premazati krem sirom, posuti koprom, a zatim staviti zelenu salatu, dimljenu pastrmku i poklopiti drugom kri&scaron;kom hljeba.</div>\r\n</div>\r\n</div>',8),(44,'<p>U &scaron;erpu dodati maslac, mlijeko, &scaron;ećer i čokoladu za kuhanje. Kuhati dok se &scaron;ećer i čokolada ne otope.</p>',9),(45,'<p>Sačekati da se malo ohladi, a zatim dodati mlijeko u prahu i mljeveni keks. Izmije&scaron;ati.</p>',9),(46,'<p>Dobijenu smjesu ravnomjerno rasporediti na jedan list oblatne i poklopiti drugim.</p>',9),(47,'<p>Lagano pritisnuti. Ostaviti u frižider na nekoliko sati ili preko noći.</p>',9),(48,'<p>Izrezati i poslužiti.</p>',9),(49,'<p>U zdjelu dodati bra&scaron;no, mu&scaron;katni ora&scaron;čić, &scaron;ećer, kvasac i so. Izmije&scaron;ati. Zatim dodati mlijeko, maslac i jaje. Izmije&scaron;ati. Mije&scaron;ati uz pomoć miksera 3-4 minute ili ručno 10 minuta. Tijesto treba da bude mekano. Ukoliko mije&scaron;ate ručno, nauljite ruke i radnu povr&scaron;inu kako se tijesto ne bi lijepilo.</p>',10),(50,'<p>Tijesto staviti u nauljenu zdjelu i pokriti plastičnom folijom. Ostaviti da nadolazi na toplom mjestu 1-2 h ili dok se ne udvostruči.</p>',10),(51,'<p>Pobra&scaron;niti radnu povr&scaron;inu. Razvaljati tijesto tako da bude od prilike 1 cm debljine. Izrezati po želji a zatim redati na papir za pečenje, ostavljajući prostora između krofni. Pokriti kuhinjskom krpom i ostaviti da nadolaze 30 minuta.</p>',10),(52,'<p>U &scaron;erpi zagrijati ulje. Izrezati papir za pečenje oko krofni i prebaciti krofne u ulje. Na taj način će krofne zadržati svoj oblik. Čim dodate krofnu u ulje, odmah izvaditi papir.</p>',10),(53,'<p>Pržiti krofne s obje strane dok ne poprime zlatnu boju.</p>',10),(54,'<p>Otopiti mliječnu čokoladu. Umakati krofne. Po želji posuti mrvicama ili ukrasiti bijelom čokoladom.</p>',10),(55,'<p>Pileće filete narežite na kockice, stavite u dublju posudu i pospite Vegetom Natur za piletinu.</p>',12),(56,'<p>Opranu papriku očistite od sjemenki i također narežite na kockice. Bijeli dio oči&scaron;ćenog mladog luka narežite na veće komade, oprane &scaron;ampinjone na četvrtine, a tikvice na kockice.</p>',12),(57,'<p>Narezano povrće malo posolite, dodajte piletinu, zalijte pivom i sve dobro izmije&scaron;ajte.</p>',12),(58,'<p>Pokrijte meso povrćem i ostavite da odstoji na hladnom mjestu oko 30 minuta, a zatim ga nanižite na drvene ražnjiće.</p>',12),(59,'<p>Re&scaron;etku ili tiganj za ro&scaron;tilj premažite uljem i dobro zagrijte. Pripremljene ražnjiće pržite sa svih strana dok ne dobiju zlatnožutu boju.</p>',12),(60,'<p><strong>Podloga: </strong>U zdjeli pomije&scaron;ajte mljeveni biskvit i omek&scaron;ali puter. Zatim smjesu istresite u kalup za torte prečnika 22 cm, rasporedite je i lagano pritisnite.</p>',15),(61,'<p><strong>Fil: </strong>U činiju dodajte krem ​​sir, &scaron;ećer, vanilin &scaron;ećer, jaja i pavlaku. Mikserom sjedinite sastojke. Dobijenu smesu od sira rasporedite po pripremljenoj podlozi. Pripremljeni kolač pecite u prethodno zagrijanoj rerni na 180 stepeni 30 minuta.</p>',15),(62,'<p><strong>Preljev od jagoda:&nbsp;</strong>Gustin pomije&scaron;ajte sa 50 ml vode. Operite, očistite i narežite jagode na manje komade. U &scaron;erpu dodajte oprane i narezane jagode, &scaron;ećer i 200 ml vode. Jagode kuhajte na laganoj vatri dok ne omek&scaron;aju. Uklonite ih s vatre i usitnite &scaron;tapnim mikserom. Dodajte pripremljeni gustin, vratite na vatru i kratko kuhajte. Vrući preljev odmah prelijte preko fila.</p>\r\n<p>&nbsp;</p>',15),(63,'<p>Gotov cheesecake ohladite na sobnoj temperaturi i stavite u frižider. Prije serviranja ukrasite svježim jagodama.</p>',15),(64,'<p><strong>Marinada</strong>: U manju zdjelu dodati papriku, bijeli luk u prahu, čili u prahu, kumin, so, biber i maslinovo ulje. Izmije&scaron;ati.</p>',18),(65,'<p>Marinadom premazati pileći file. Zagrijati tavu. Peći na srednje jakoj temperaturi oko 15 minuta, ovisno o debljini pilećeg filea.</p>',18),(66,'<p>Ako pileći file počne prebrzo da rumeni, smanjiti temperaturu.</p>',18),(67,'<p>U zdjelu dodati zelenu salatu, paradajz, avokado, parmezan i talijansku mje&scaron;avinu. Izmije&scaron;ati.</p>',18),(68,'<p>Pileći file prebaciti na dasku za rezanje i izrezati na trakice.</p>',18),(69,'<p>Salatu poslužiti s trakicama piletine. Prijatno!</p>\r\n<p>&nbsp;</p>\r\n<p><img title=\"IMG_7756-1080x578.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"400\" height=\"214\" /></p>',18),(72,'<p>Tortilju namazati majonezom.</p>',20),(73,'<p>Preko rasporediti zelenu salatu, pureću &scaron;unku, cheddar, paradajz i jalapeno.</p>',20),(74,'<p>Zarolati i poslužiti. Prijatno!</p>\r\n<p>&nbsp;</p>\r\n<p><img title=\"IMG_8007-1080x578.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"400\" height=\"214\" /></p>',20),(75,'<p>U &scaron;erpu dodati zobene pahuljice, mlijeko, jagode, aromu vanilije i javorov sirup.</p>',22),(76,'<p>Nakon &scaron;to zavri, kuhati na niskoj temperaturi oko 10 minuta ili dok ne postignete željenu gustoću.</p>',22),(77,'<p>Naspite u zdjele i poslužite. Prijatno!</p>',22),(78,'<p>U zdjelu dodati piletinu, so, sok i koricu limete. Izmije&scaron;ati. Pokriti plastičnom folijom i ostaviti po strani.</p>',23),(79,'<p>U tavi zagrijati maslinovo ulje. Tostirati polovice vekni, 20-30 sekundi, zatim izvaditi iz tave i ostaviti po strani.</p>',23),(80,'<p>U istu tavu dodati piletinu, pržiti 4-5 minuta ili dok piletina ne bude pečena.</p>',23),(81,'<p>Na donje vekne namazati krem sir, zatim dodati piletinu, kri&scaron;ke paradajza, baby &scaron;pinat i kri&scaron;ke avokada.</p>',23),(82,'<p>Poklopiti gornjom veknom i poslužiti. Prijatno!</p>',23),(83,'<p><strong>Pire:</strong>&nbsp;U zdjelu dodati kuhani krompir, maslac, mlijeko i 1 malu ka&scaron;iku soli. Napraviti pire. Ravnomjerno rasporediti na dno pekača.</p>',24),(84,'<p><strong>Polpete:</strong>&nbsp;U zdjelu dodati mljeveno meso, kru&scaron;ne mrvice, 1 ka&scaron;iku suhog per&scaron;una, 1 mala ka&scaron;iku soli, biber i slatku papriku. Izmije&scaron;ati. Podijeliti na 9 jednakih dijelova. Oblikovati polpete.</p>',24),(85,'<p>U tavi zagrijati suncokretovo ulje. Zapeći polpete sa svih strana. Izvaditi iz tave. Polpete lagano utisnuti u pire.</p>',24),(86,'<p>Umak:&nbsp;U istu tavu dodati paradajz pastu, paradajz sos i1 ka&scaron;iku per&scaron;una. Nakon &scaron;to zavri kuhati na laganoj vatri oko 5 minuta. Dobijeni umak preliti preko polpeta.</p>',24),(87,'<p>Polpete posuti naribanim edamerom.</p>',24),(88,'<p>Peći na 180&deg;C, 10-15 min ili dok se sir ne otopi.</p>',24),(89,'<p>U zdjelu dodati jaja, mlijeko, biber i so. Izmije&scaron;ati.</p>',26),(90,'<p>U tavi s neprijanjajućim dnom otopiti maslac.</p>',26),(91,'<p>Kri&scaron;ke hljeba namakati oko 30 sekundi s obje strane u smjesi od jaja, a zatim dodati u tavu.</p>',26),(92,'<p>Pržiti na srednje jakoj temperaturi s jedne, a zatim druge strane, dok ne poprime zlatnu boju.</p>',26),(93,'<p>Nakon &scaron;to ispečete tost, u istu tavu dodati paradajz. Paradajz pržiti oko 1 minute a zatim poslužiti s tostom i feta sirom. Prijatno!</p>',26),(94,'<p>U multipraktik dodajte jagode (ako koristite smrznute, odmrznite jagode oko 1 sat prije mije&scaron;anja) i mije&scaron;ajte dok ne dobijte glatku smjesu.</p>',27),(95,'<p>U veliku zdjelu dodajte vrhnje za &scaron;lag. Mije&scaron;ajte dok ne dobijete čvrsti snijeg.</p>',27),(96,'<p>Zatim dodajte slatko kondenzovano mlijeko i jagode. Mije&scaron;ajte dok se sastojci ne sjedine.</p>',27),(97,'<p>Prebacite u posudu, čuvati u zamrzivaču najmanje 6 sati. Prijatno!</p>',27);
